// 테스트 용 임시 데이터
function getBalance(birthDate, accountNo, accountPassword){
    var custDB = []
    var custObj = {
        name : '홍길동',
        birthDate : '761020',
        mobileNo : '01012345678',
        accountNo : '110123456789',
        accountPassword : '1234',
        balance : '1000000'
    }
    
    custDB.push(custObj)
    
    custObj = {
        name : '성춘향',
        birthDate : '911111',
        mobileNo : '01011111111',
        accountNo : '110111111111',
        accountPassword : '1111',
        balance : '15598000'
    }
    
    custDB.push(custObj)
    
    var index = -1
    for(var i=0; i<custDB.length; i++){
        if (custDB[i].accountNo == accountNo) {
            index = i
            break
        }
    }

    if(index == -1){
        return "0000"
    } else {
        if(custDB[index].birthDate == birthDate) {
            if(custDB[index].accountPassword == accountPassword) {
                return custDB[index].balance
            } else {
                return "0002"
            }
        } else {
            return "0001"
        }
    }
}

birthDate = userParameter.get("current_user_birthdate")
accountNo = userParameter.get("current_user_account_number")
accountPassword = userParameter.get("current_user_account_password")


var balance = getBalance(birthDate, accountNo, accountPassword)

if(balance == "0000"){
    userParameter.put("validation", "false")
    userParameter.put("failMessage", "입력하신 계좌번호로 조회할 수 없습니다.")
} else if(balance == "0001"){
    userParameter.put("validation", "false")
    userParameter.put("failMessage", "입력하신 주민번호와 해당 계좌에 등록된 주민번호가 일치하지 않습니다.")
} else if(balance == "0002"){
    userParameter.put("validation", "false")
    userParameter.put("current_user_account_balance", balance)
}
else{
    userParameter.put("validation", "true")
    userParameter.put("current_user_account_balance", balance)
}

